export class Tuple0 {}

export class Tuple1<T1> {
    val1: T1;
}

export class Tuple2<T1, T2> {
    val1: T1;
    val2: T2;
}

export class Tuple3<T1, T2, T3> {
    val1: T1;
    val2: T2;
    val3: T3;
}

export class Tuple4<T1, T2, T3, T4> {
    val1: T1;
    val2: T2;
    val3: T3;
    val4: T4;
}
